  [],\n\t\"revision_timestamp\": \"2016-07-27T22:46:19.962756\",\n\t\"name\": \"horicon-national-wildlife-refuge-narrative-report-september-december-1955\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Horicon National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1955. The report begins by summarizing the weather conditions and water conditions
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, predators, rodents, raptors and fish- is also covered.
  The Refuge development and maintenance section discusses physical development, plantings,
  vegetation control, and wildfires. Resource management is outlined; topics include
  grazing and haying. A progress report on field investigations and applied research
  is also provided. The public relations section of the report describes recreational
  uses, Refuge visitors, Refuge participation, hunting, fishing, and violations. N-R
  forms and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
